        <div className="font-bold text-lg mb-2"><a href={`https://whatsonchain.com/${ordinal.txid}`}>{ordinal.txid}</a></div>
        <div className="font-bold text-lg mb-2">{lrcName}</div>
          <div className="font-bold text-lg mb-2">{ordinal.data.insc.json.amt}</div>

        </div>
      </div>
    );
  };

  export default LRCCard;
